import React from 'react';
import piano from '../../assets/piano2.jpg';
import violin from '../../assets/violin.jpg';
import trombone from '../../assets/trombone.jpg';
import './HomePageSecond.css';

function SetCollapsibleListener(collapsible)
{
    collapsible.addEventListener("click", function() {
        alert("Hello!");
    }
    )
}

function GetAllCollapsibles()
{
    return document.getElementsByClassName("home-page-second-card");
}

function SetCollapsibleListeners()
{
    for (var collapsible of GetAllCollapsibles())
    {
        SetCollapsibleListener(collapsible)
        collapsible.style.display = 'none';
    }
}

function HomePageSecond()
{
    return(
        <div id = "home-page-second">
            <div id = "home-page-second-title">Instruments We Teach</div>
            <div id = "home-page-second-catalog">
                <div className = "home-page-second-card">
                    <img src = {violin} />
                    <br />
                    <div className = "home-page-second-card-title">
                        <div className = "home-page-second-card-title-text">
                        Violin
                        </div>
                        <div className = "home-page-second-card-button">
                           &#43;
                        </div>
                    </div>
                </div>
                <div className = "home-page-second-card-content">
                    Hello
                </div>
                <div className = "home-page-second-card">
                    <img src = {violin} />
                    <br />
                    <div className = "home-page-second-card-title">
                        <div className = "home-page-second-card-title-text">
                        Violin
                        </div>
                        <div className = "home-page-second-card-button">
                           &#43;
                        </div>
                    </div>
                </div>
                <div className = "home-page-second-card">
                    <img src = {violin} />
                    <br />
                    <div className = "home-page-second-card-title">
                        <div className = "home-page-second-card-title-text">
                        Violin
                        </div>
                        <div className = "home-page-second-card-button">
                           &#43;
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}

SetCollapsibleListeners()

export default HomePageSecond
